import React, { useState, useEffect } from "react";
import "../scss/_TakeQuiz.scss";
import TakeQuizScrolbar from "./TakeQuizScrolbar";
import TakeQuizButtons from "./TakeQuizButtons";

function TakeQuiz() {
  useEffect(() => {
    fetchAllQuizes();
  },[]);

  let [allQuizes, setAllQuizes] = useState([]);

  const fetchAllQuizes = () => {
    fetch("http://localhost:4000/quizs")
      .then((resp) => resp.json())
      .then((data) => setAllQuizes(data));
  };
  return (
    <div className="TakeQuizContent">
      {/* <TakeQuizScrolbar allQuizes={allQuizes} /> */}
      <TakeQuizButtons/>
    </div>
  );
}

export default TakeQuiz;
